import React from "react";

const Navbar = (props) => {

return (
    <nav>
        <h1>TIENDA ONLINE</h1>
        <ul>
            <li><a href="#">Inicio</a></li>
            <li><a href="#">Productos</a></li>
            <li><a href="#">Contacto</a></li>
            <li><a href="#">Nosotros</a></li>
            <li><a href="#">Carrito</a></li>
        </ul>
    </nav>
);
};

export default Navbar;
